window.bookSummaryJSON = "<p><b>From the author of The Millennium Wolves series comes the hauntingly romantic story of a young woman’s descent into a League of vampires, and the Lord who means to keep her there.</b></p> <p>Aileen Henderson’s unassuming life conceals a dark past. Outside of work, she hides behind her larger-than-life best friend, Cassidy, whose constant need for attention suits Aileen—and her secrets—just fine.</p> <p>Until the night Aileen dies.</p> <p>Awakening to a new world of brutality, bloodlust, and betrayal, Aileen plots revenge against Ragnor Rayne, the monster who cursed her with the Imprint. The demon who turned her into a vampire. The man whose eyes haunt her dreams.</p> <p>She is going to make this vampire Lord regret the day he kissed her with the curse of immortality and made her his. If she can survive the Auction, and resist temptations of the flesh…</p>"; 
